const getValuesByScore = (value, max, target) => {
  let activeIndex = 0;

  if (max === 0) {
    activeIndex = 4;
  } else {
    const score = value / max * 100;

    if (score >= 90) {
      activeIndex = 0;
    } else if (score < 90 && score > 75) {
      activeIndex = 1;
    } else if (score > 60 && score < 76) {
      activeIndex = 2;
    } else if (score >= 40 && score <= 60) {
      activeIndex = 3;
    } else if (score < 40) {
      activeIndex = 4;
    }
  }

  const colorList = [{
    label: "Great",
    color: "#74b287"
  }, {
    label: "Above Average",
    color: "#a9c466"
  }, {
    label: "Average",
    color: "d8c539"
  }, {
    label: "Below Average",
    color: "#e89258"
  }, {
    label: "Poor",
    color: "#f27c7c"
  }];

  if (target === 'color') {
    return colorList[activeIndex].color;
  }

  return colorList[activeIndex].label;
};

